import { useState, useEffect } from "react";

function changePageZIndex(newPageDestination) {
    const home = document.getElementsByClassName('home')
    const makeAppointment = document.getElementsByClassName('makeAppointment')
    const aboutUs = document.getElementsByClassName('aboutAndContact')

    useEffect(() => {
        if (newPageDestination === 'home') {
            home.style.zIndex = 2;
            makeAppointment.style.zIndex = 1;
            aboutUs.style.zIndex = 1;
        } else if (newPageDestination === 'makeAppointment') {
            home.style.zIndex = 1;
            makeAppointment.style.zIndex = 2;
            aboutUs.style.zIndex = 1;
        } else if (newPageDestination === 'aboutAndContact') {
            home.style.zIndex = 1;
            makeAppointment.style.zIndex = 1;
            aboutUs.style.zIndex = 2;
        } 
    })
}
    
export default changePageZIndex;
